  return (
    <div className="p-8 bg-gray-100 min-h-screen">
      {/* Wyśrodkowany tytuł "Moje Notatki" */}
      <h1 className={styles.pageTitle}>Moje Notatki</h1>  {/* Używamy CSS Modules */}
      <NotesList />
    </div>
  );
}

export default App;
